&lt;p&gt;
	This project builds from the work of the first year of effort that successfully integrated the Spacesuit&amp;nbsp; Water Membrane Evaporator (SWME), developed by the JSC Engineering Directorate,&amp;nbsp; and&amp;nbsp; the&amp;nbsp; Lithium Chloride Absorber Radiator (LCAR) developed by Creare Inc. as a flexible, bendable system, into a non-venting system for thermal control.&amp;nbsp; This system could be made more advantageous for spacecraft and Portable Life Support Systems (PLSS), from a mass and volume standpoint, by building&amp;nbsp; the structure of the spacecraft or the PLSS housing&amp;nbsp; with high-strength carbon fiber composite honeycomb,&amp;nbsp; the cells of which would be filled with the chemical absorption media.&amp;nbsp; In this way the multifunctional composite element provides structural strength, desiccant storage and the radiator surface area required for heat rejection.&amp;nbsp; A 2 ft2 panel will be constructed and tested in thermal and thermal vacuum conditions.&amp;nbsp; A flight-like regeneration system will also be built and tested. A thermal fluid model will be built and correlated&amp;nbsp; to the test data.&lt;/p&gt;
&lt;p&gt;
	&amp;nbsp;&lt;/p&gt;
&lt;p&gt;
	The entire stack would have a depth of 12 mm, and include the storage stack honeycomb of 8 mm in depth, an internal vapor header, and an external radiator face sheet.&amp;nbsp; In this way, the housing multifunctionally provides the necessary housing protective structure, desiccant storage capacity, and radiator surface to reject the heat. The 8mm depth of storage media suggests more efficient absorption resulting in a potential radiator temperature of 330K.&amp;nbsp; A similar arrangement would be useful in providing a non-venting topping function for orbiting spacecraft during low lunar orbit where both heat rejection requirements and 290 K peak sink temperature are relatively high.&amp;nbsp; Regeneration could be conducted during colder parts of the orbit where there is more available cooling for a condensing heat exchanger.&lt;/p&gt;
